import React, { Component } from 'react'


import './index.less'


/*
  左侧导航栏
 */
export default class LeftNav extends Component {
  render() {
    return (
      <div className='left-nav'>
        <header className='left-nav-header'>
          <img src="" alt=""/>
          <h1>后台管理</h1>
        </header>
      </div>
    )
  }
}
